import React from 'react'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Add from './Add'
const Navbar = () => {
  return (
    <div>
         <BrowserRouter>
      <Routes>
        <Route path="/" component={<Add />}>
          {/* <Route index component={<Home />} /> */}
        </Route>
      </Routes>
    </BrowserRouter>
    </div>
  )
}

export default Navbar
